"use strict";(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[932206],{932206:n=>{n.exports=JSON.parse('{"items":[{"id":"what-kind-of-breakfast-is-served-at-hostel-brikette","question":"Hostel Brikette phục vụ bữa s\xe1ng như thế n\xe0o?","answer":"Kh\xe1ch được thưởng thức thực đơn gọi m\xf3n được đ\xe1nh gi\xe1 cao. Đặt trực tiếp để nhận bữa s\xe1ng miễn ph\xed."},{"id":"what-are-the-check-in-and-check-out-times-at-hostel-brikette","question":"Giờ nhận ph\xf2ng v\xe0 trả ph\xf2ng tại Hostel Brikette l\xe0 khi n\xe0o?","answer":"Nhận ph\xf2ng diễn ra từ 15:00 đến 22:30; trả ph\xf2ng từ 07:30 đến 10:30."},{"id":"how-much-does-it-cost-to-stay-at-hostel-brikette","question":"Chi ph\xed lưu tr\xfa tại Hostel Brikette l\xe0 bao nhi\xeau?","answer":"Gi\xe1 ph\xf2ng thay đổi theo ng\xe0y v\xe0 loại ph\xf2ng. Để xem gi\xe1 mới nhất, h\xe3y t\xecm kiếm theo ph\xf2ng v\xe0 ng\xe0y bạn muốn ở."},{"id":"what-is-there-to-do-at-hostel-brikette","question":"Ở Hostel Brikette c\xf3 những hoạt động n\xe0o?","answer":"Hostel tổ chức hoặc gợi \xfd c\xe1c chuyến đi bộ đường d\xe0i; những hoạt động kh\xe1c c\xf3 thể t\xednh th\xeam ph\xed."},{"id":"how-far-is-hostel-brikette-from-the-centre-of-positano","question":"Hostel Brikette c\xe1ch trung t\xe2m Positano bao xa?","answer":"Chỗ nghỉ c\xe1ch trung t\xe2m Positano khoảng 350 m\xe9t."},{"id":"how-close-to-the-beach-is-hostel-brikette","question":"Hostel Brikette c\xe1ch b\xe3i biển bao xa?","answer":"B\xe3i biển gần nhất c\xe1ch khoảng 350 m\xe9t."},{"id":"what-room-types-are-available-at-hostel-brikette","question":"Hostel Brikette c\xf3 những loại ph\xf2ng n\xe0o?","answer":"Bạn c\xf3 thể đặt giường trong ph\xf2ng ngủ tập thể hỗn hợp, ph\xf2ng tập thể nữ hoặc ph\xf2ng đ\xf4i ri\xeang c\xf3 ph\xf2ng tắm kh\xe9p k\xedn."},{"id":"does-hostel-brikette-have-a-terrace-with-sea-views","question":"Hostel Brikette c\xf3 s\xe2n thượng ngắm biển kh\xf4ng?","answer":"C\xf3. S\xe2n thượng chung rộng r\xe3i nh\xecn trọn Positano v\xe0 mở ra tầm nh\xecn biển to\xe0n cảnh."},{"id":"is-free-wi-fi-provided","question":"C\xf3 Wi-Fi miễn ph\xed kh\xf4ng?","answer":"C\xf3. Wi-Fi miễn ph\xed phủ s\xf3ng to\xe0n bộ khu\xf4n vi\xean."},{"id":"is-breakfast-included-in-the-rate","question":"Gi\xe1 ph\xf2ng c\xf3 bao gồm bữa s\xe1ng kh\xf4ng?","answer":"Nếu bạn đặt trực tiếp th\xec gi\xe1 đ\xe3 bao gồm bữa s\xe1ng; đặt qua k\xeanh kh\xe1c sẽ t\xednh th\xeam ph\xed bữa s\xe1ng."},{"id":"does-hostel-brikette-have-an-on-site-bar","question":"Hostel Brikette c\xf3 quầy bar tại chỗ kh\xf4ng?","answer":"C\xf3. Quầy bar phục vụ c\xe0 ph\xea, đồ ăn nhẹ, bữa s\xe1ng, m\xf3n tối v\xe0 đồ uống hằng ng\xe0y từ 07:30 đến 23:30."},{"id":"can-i-store-my-luggage-before-check-in-or-after-check-out","question":"T\xf4i c\xf3 thể gửi h\xe0nh l\xfd trước giờ nhận ph\xf2ng hoặc sau khi trả ph\xf2ng kh\xf4ng?","answer":"C\xf3. Ch\xfang t\xf4i giữ h\xe0nh l\xfd cho kh\xe1ch nhận ph\xf2ng từ 10:30 trở đi, v\xe0 cho kh\xe1ch trả ph\xf2ng từ 07:30 đến 15:30."},{"id":"are-there-age-restrictions-at-hostel-brikette","question":"Hostel Brikette c\xf3 giới hạn độ tuổi kh\xf4ng?","answer":"Ph\xf2ng ngủ tập thể chỉ nhận kh\xe1ch từ 18 đến 39 tuổi. Ph\xf2ng ri\xeang kh\xf4ng \xe1p dụng giới hạn n\xe0y."},{"id":"are-children-allowed","question":"C\xf3 cho ph\xe9p trẻ em lưu tr\xfa kh\xf4ng?","answer":"Ph\xf2ng ngủ tập thể chỉ d\xe0nh cho người lớn v\xe0 kh\xf4ng nhận trẻ em. H\xe3y đặt ph\xf2ng ri\xeang nếu bạn cần tr\xe1nh giới hạn độ tuổi."},{"id":"are-pets-allowed","question":"C\xf3 cho mang theo th\xfa cưng kh\xf4ng?","answer":"Rất tiếc, ch\xfang t\xf4i kh\xf4ng cho ph\xe9p th\xfa cưng trong khu\xf4n vi\xean."},{"id":"does-the-hostel-have-its-own-parking","question":"Hostel c\xf3 b\xe3i đỗ xe ri\xeang kh\xf4ng?","answer":"Kh\xf4ng c\xf3 chỗ đỗ xe trong khu\xf4n vi\xean; bạn c\xf3 thể gửi xe tại c\xe1c b\xe3i c\xf4ng cộng c\xf3 thu ph\xed ở Positano."},{"id":"is-air-conditioning-available","question":"C\xf3 điều h\xf2a kh\xf4ng?","answer":"C\xf3. Mọi ph\xf2ng ri\xeang v\xe0 ph\xf2ng ngủ tập thể đều được trang bị điều h\xf2a."},{"id":"are-lockers-provided-in-the-dormitories","question":"Ph\xf2ng tập thể c\xf3 tủ kh\xf3a ri\xeang kh\xf4ng?","answer":"C\xf3. Mỗi giường đều c\xf3 tủ kh\xf3a ri\xeang; h\xe3y mang theo ổ kh\xf3a của bạn hoặc mua tại lễ t\xe2n."},{"id":"are-towels-included","question":"Gi\xe1 ph\xf2ng c\xf3 bao gồm khăn tắm kh\xf4ng?","answer":"Ch\xfang t\xf4i ph\xe1t khăn tắm khi bạn nhận ph\xf2ng; khăn đi biển c\xf3 thể thu\xea th\xeam."},{"id":"is-bed-linen-included","question":"C\xf3 bao gồm ga giường kh\xf4ng?","answer":"C\xf3. Ch\xfang t\xf4i chuẩn bị bộ ga giường sạch khi bạn nhận ph\xf2ng."},{"id":"does-hostel-brikette-have-laundry-facilities","question":"Hostel Brikette c\xf3 dịch vụ giặt l\xe0 kh\xf4ng?","answer":"Kh\xf4ng c\xf3 m\xe1y giặt trong khu\xf4n vi\xean, nhưng c\xf3 v\xe0i tiệm giặt l\xe0 ngay gần hostel."},{"id":"does-hostel-brikette-have-quiet-hours","question":"Hostel Brikette c\xf3 giờ y\xean tĩnh kh\xf4ng?","answer":"Giờ y\xean tĩnh từ 23:30 đến 07:30."},{"id":"how-do-i-get-to-hostel-brikette-from-naples-airport","question":"T\xf4i đi từ s\xe2n bay Naples đến Hostel Brikette bằng c\xe1ch n\xe0o?","answer":"Bản dịch đang được chuẩn bị."},{"id":"where-is-the-nearest-bus-stop","question":"Trạm xe bu\xfdt gần nhất ở đ\xe2u?","answer":"Điểm dừng Chiesa Nuova c\xe1ch hostel chưa tới 80 m (khoảng 250 ft) v\xe0 kh\xf4ng c\xf3 bậc thang tr\xean đường đi."},{"id":"what-payment-methods-are-accepted","question":"Nhận những phương thức thanh to\xe1n n\xe0o?","answer":"Lễ t\xe2n chấp nhận Visa, Mastercard, Maestro, thẻ ATM v\xe0 tiền mặt."},{"id":"is-reception-open-24-hours","question":"Quầy lễ t\xe2n c\xf3 mở 24/24 kh\xf4ng?","answer":"Lễ t\xe2n mở cửa từ 07:30 đến 22:30. Nếu đến muộn, bạn cần b\xe1o trước để sắp xếp."},{"id":"does-hostel-brikette-have-a-shared-kitchen","question":"Hostel Brikette c\xf3 bếp d\xf9ng chung kh\xf4ng?","answer":"Kh\xf4ng c\xf3 bếp chung, nhưng bạn c\xf3 thể d\xf9ng tủ lạnh, ấm đun nước v\xe0 l\xf2 vi s\xf3ng."},{"id":"does-hostel-brikette-offer-female-only-dorms","question":"Hostel Brikette c\xf3 ph\xf2ng ngủ tập thể d\xe0nh ri\xeang cho nữ kh\xf4ng?","answer":"C\xf3. Bạn c\xf3 thể đặt giường trong ph\xf2ng ngủ tập thể d\xe0nh ri\xeang cho nữ."},{"id":"is-the-property-wheelchair-accessible","question":"Chỗ nghỉ c\xf3 ph\xf9 hợp cho xe lăn kh\xf4ng?","answer":"Rất tiếc, hostel chưa hỗ trợ tiếp cận bằng xe lăn."}]}')}}]);